      data:{
        a:[],
       name:"",
       class:"",
       location:""
      }
    }
  }
  render() {
    return template.call(this);
  }
  fn(e){
let value=e.target.value;
this.state.a.push(value);
console.log(value);
console.log(this.state.a);
  }

}

